INSERT INTO `table_comment` VALUES (25, 0, 2, 3, 'Thất vọng về sản phẩm', 'Hiện tại thì mình thấy tai nghe ổn áp\r\nMong sẽ dùng được lâu , hope\r\n🎶😢💖😜🙌🤦‍♀️🤞👌✌️😒', 'Quốc tuấn', '0939584545', 'quoctuan.nina@gmail.com', '', 'hienthi', 'san-pham', 1640149452);
INSERT INTO `table_comment` VALUES (26, 0, 2, 5, 'Sản phẩm rất tốt', 'Giao hàng nhanh lắm nhé mọi người, giá rẻ, dùng cũng ổn so với giá tiền, tầm vài tháng. Đây là lần thứ hai mua ở đây, sẽ tiếp tục ủng hộ shop 🌻😊❤️😍😘🤦‍♂️🤷‍♀️🤷‍♂️💕😁👍', 'Kim liên', '0939584545', 'kimlien@gmail.com', '', 'hienthi', 'san-pham', 1640149495);
INSERT INTO `table_comment` VALUES (33, 26, 2, 0, '', '@Kim liên: Giao hàng hơi lâu xíu. Shop tư vấn nhiệt tình, chu đáo, mic thu hay. Xứng đáng với giá tiền. Tuy nhiên bảo tặng tai nghe cho m nhưng shop ko gửi. Nên hơi buồn vì cứ chờ shop ship lại tai nghe mà ko thấy, nếu ko tặng thì shop nên bảo khách luôn để khách khỏi chờ thì hay hơn.', 'Minh trí', '0987645364', 'minhtri.nina@gmail.com', '', 'hienthi', 'san-pham', 1640241886);
INSERT INTO `table_comment` VALUES (34, 26, 2, 0, '', '@Kim liên: Tư vấn rất nhiệt tình, gửi hàng nhanh, mic và soudcard tốt, hàng chính hãng, rất tốt 5 sao shop 👍👍👍👍👍', 'Lệ thu', '0987425347', 'lethu@gmail.com', '', 'hienthi', 'san-pham', 1640241974);
INSERT INTO `table_comment` VALUES (38, 26, 2, 0, '', '@Kim liên: Mic hát khá hay 🥰 giao hàng nhanh hihhii', 'Lệ quyên', '0925364857', 'lequyen.nina@gmail.com', '', 'hienthi', 'san-pham', 1640245399);
