INSERT INTO `table_pushonesignal` VALUES (2, 'Nike Epic React Phantom, bỏ hoàn toàn dây buộc, dễ xỏ như giày lười', 'https://www.google.com/', 'poduct-9-6725-9826.jpg', 'Nếu bạn đã quá chán với việc buộc và bị tuột dây giày.\r\nAirmax 97 với khóa dây thông minh sẽ giúp bạn không bao giờ phải đối mặt với tình trạng này nữa.', 1620825470, 2);
INSERT INTO `table_seo` VALUES (223, 185, 'news', 'man', 'dich-vu', 'Quạt hút bụi Bình Dương giá cạnh tranh | Đảm bảo chất lượng sản phẩm', 'quạt hút bụi Bình Dương', 'Bạn có nhu cầu tìm mua quạt hút bụi Bình Dương nhưng chưa biết đơn vị cung cấp nào đáng tin cậy? Liệu giá thành sản phẩm có hợp lý? THAM KHẢO NGAY NHÉ!', NULL, NULL, NULL);
