INSERT INTO `table_seo` VALUES (420, 37, 'news', 'man', 'tin-tuc', 'Tin tức , CÔNG TY CƠ KHÍ MINH AN PHÁT', 'chế tạo máy công nghiệp , công ty minh an phát , hệ thống hút bụi , bồn hút bụi', 'Công ty TNHH Minh An Phát với hơn 8 năm kinh nghiệm trong lĩnh vực chế tạo hệ thống thông gió, hút bụi, xử lý khí thải công nghiệp', NULL, NULL, NULL);
