INSERT INTO `table_seo` VALUES (509, 126, 'news', 'man', 'tin-tuc', '', '', '', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (510, 127, 'news', 'man', 'tin-tuc', '', '', 'Hiện nay, tình trạng ô nhiễm môi trường đặc biệt là chất lượng không khí nước ta đang là vấn đề đáng báo động', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (511, 128, 'news', 'man', 'tin-tuc', '', '', 'Hệ thông hút bụi sẽ giúp hút hết bụi bẩn do quá trình sản xuất, làm việc thải ra, lưu thông điều hòa không khí giúp cho môi trường làm việc được trong lành và sach sẽ', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (512, 129, 'news', 'man', 'tin-tuc', '', '', 'Với sự phát triển mạnh mẽ của ngành công nghiệp chế biến gỗ, việc trang bị, lắp đặt hệ thống hút bụi cho xưởng sản xuất được đánh giá là giải pháp tối ưu nhất', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (513, 130, 'news', 'man', 'tin-tuc', '', '', 'Trước khi thi công hệ thống hút lọc bụi công nghiệp cần xem xét những tiêu chuẩn sau đây để quá trình lắp đặt đạt được hiệu quả tốt nhất:', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (514, 131, 'news', 'man', 'tin-tuc', 'Tìm hiểu về hệ thống hút lọc bụi công nghiệp', '', 'Hiện nay, ô nhiễm môi trường, ô nhiễm không khí do khói bụi bẩn đã trở thành vấn đề đáng báo động. Hệ thống hút lọc bụi công nghiệp là giải pháp tuyệt vời giúp xử lý bụi bẩn 1 cách triệt để và tối ưu nhất.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (515, 132, 'news', 'man', 'tin-tuc', 'Phương pháp xử lý khí thải bằng than hoạt tính hiệu quả cao', '', 'Xử lý khí thải là việc quan trọng và cần thiết cho mỗi khu công nghiệp. Nhằm hạn chế lượng khí thải thải ra môi trường, bảo vệ sức khoẻ con người.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (516, 133, 'news', 'man', 'tin-tuc', 'Vì sao cần lắp đặt hệ thống hút bụi gỗ?', '', 'Bụi gỗ được sinh ra trong quá trình sản xuất, gia công, chế tạo gỗ là những hạt bụi vô cùng độc hại. Chúng gây nên những nguy hiểm cho môi trường và sức khỏe con người.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (517, 134, 'news', 'man', 'tin-tuc', 'Cấu tạo của hệ thống hút bụi xưởng gỗ', '', 'Cấu tạo của hệ thống hút lọc bụi xưởng gỗ bao gồm quạt ly tâm công suất lớn, hệ thống thùng chứa bụi, các ống dẫn, chụp hút, van gió... kết hợp tạo thành một hệ thống nhất.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (518, 135, 'news', 'man', 'tin-tuc', 'Ống gió là gì? Các loại ống gió hiện nay', '', 'Ống gió không phải thuật ngữ mới tuy nhiên không mấy người hiểu rõ khái niệm ống gió là gì? Hiểu rõ khái niệm và phân biệt các loại ống gió giúp cho việc lựa chọn và sử dụng hiệu quả hơn rất nhiều!', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (519, 136, 'news', 'man', 'tin-tuc', 'Vai trò của hệ thống xử lý khí thải các ngành công nghiệp hiện nay', 'Vai trò của hệ thống xử lý khí thải ', 'Giải pháp xử lý khí thải vẫn là mối quan tâm của nhiều doanh nghiệp. Việc lắp đặt hệ thống xử lý khí thải là điều bắt buộc trong các nhà máy, KCN có phát sinh khí thải chưa đạt yêu cầu đưa ra môi trường. ', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (520, 137, 'news', 'man', 'tin-tuc', 'Khái niệm và ưu điểm của hệ thống lọc bụi túi vải', 'Khái niệm và ưu điểm của hệ thống lọc bụi túi vải', 'Hệ thống hút lọc bụi túi vải đang là hệ thống lọc bụi được sử dụng rộng rãi hiện nay. Vấn đề xử lý bụi luôn là vấn đề quan trọng trong các nhà máy, nhà xưởng, KCN.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (521, 138, 'news', 'man', 'tin-tuc', 'Cấu tạo của hệ thống hút lọc bụi túi vải', 'Cấu tạo của hệ thống hút lọc bụi túi vải', 'Nhiều người vẫn chưa thực sự hiểu về sản phẩm này. Cùng tìm hiểu chi tiết về cấu tạo của hệ thống hút lọc bụi túi vải qua bài viết dưới đây ngay nhé nhé!', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (522, 139, 'news', 'man', 'tin-tuc', 'Tác hại của bụi chà nhám đến sức khỏe người lao động và môi trường', 'Tác hại của bụi chà nhám ', 'Phát sinh bụi trong quá trình chà nhám là không thể tránh khỏi. Cùng tìm hiểu chi tiết về tác hại của bụi chà nhám dưới đây.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (523, 140, 'news', 'man', 'tin-tuc', 'Tại sao các nhà xưởng nên lắp đặt hệ thống hút khói', 'Tại sao các nhà xưởng nên lắp đặt hệ thống hút khói', 'Để hiểu rõ hơn, trong bài viết này Minh An Phát sẽ chia sẽ rõ tại sao các nhà xưởng nên lắp đặt hệ thống hút khói.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (524, 141, 'news', 'man', 'tin-tuc', 'Cách xây dựng hệ thống cấp gió tươi cho nhà xưởng', 'Cách xây dựng hệ thống cấp gió tươi cho nhà xưởng', 'Có những cách nào để xây dựng hệ thống cấp gió tươi cho nhà xưởng? Hãy cùng chúng tôi đi tìm hiểu qua nội dung bài viết dưới đây.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (525, 142, 'news', 'man', 'tin-tuc', 'Tiêu chuẩn, quy định về hệ thống hút khói nhà xưởng', 'Tiêu chuẩn, quy định về hệ thống hút khói nhà xưởng', 'Để ống hút khói phát huy tối đa công dụng thì cần phải tuân thủ các tiêu chuẩn gì? Tìm hiểu ngay!', NULL, NULL, NULL);
