INSERT INTO `table_seo` VALUES (1103, 22, 'news', 'man', 'tin-tuc', 'Tin tức', 'nhận thầu xây dựng nhà ở, nhà phố, biệt thự miền Nam và miền Tây', 'Xây Dựng Hoàng Phúc là Nhà Thầu Tây Ninh Uy Tín chuyên xây dựng - thiết kế nhà phố, biệt thự, nhà cấp 4, nhà mái thái, nhà xưởng, showroom, nhà tiền chế,.... tại Tây Ninh, Long An, Bình Dương, Đồng Tháp, An Giang, Cần Thơ, Miền Tây,....', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1104, 1, 'news', 'man', 'tin-tuc', 'Đâu là công ty xây dựng uy tín ở Kiên Giang tốt nhất hiện nay?', 'Công ty xây dựng uy tín ở Kiên Giang', 'Bài viết hôm nay chúng tôi giới thiệu về một công ty xây dựng uy tín ở Kiên Giang uy tín, chuyên nghiệp và chất lượng hàng đầu thị trường hiện nay.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1105, 2, 'news', 'man', 'tin-tuc', 'Thiết kế biệt thự đẹp Cần Thơ đẹp, độc đáo, đẳng cấp, hiện đại', 'Thiết kế biệt thự đẹp Cần Thơ', 'Công ty thiết kế biệt thự đẹp Cần Thơ - HOÀNG PHÚC là một trong những công ty thiết kế biệt thự Cần Thơ uy tín chuyên nghiệp hàng đầu.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1106, 3, 'news', 'man', 'tin-tuc', 'Lựa chọn dịch vụ xây nhà trọn gói Bạc Liêu đáng tin cậy nhất', 'Xây nhà trọn gói Bạc Liêu', 'Nhà thầu xây nhà trọn gói Bạc Liêu - HOÀNG PHÚC là công ty xây dựng chuyên dịch vụ xây trọn gói trao tay các công trình nhà ở dân dụng lớn nhỏ.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1107, 4, 'news', 'man', 'tin-tuc', 'Khám phá một công ty xây dựng Tây Ninh chuyên nghiệp, uy tín', 'Công ty xây dựng Tây Ninh', 'Điều quan trọng nhất là phải tìm kiếm một công ty xây dựng Tây Ninh uy tín để có thể tạo nên một ngôi nhà ưng ý nhất cho mình.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1108, 5, 'news', 'man', 'tin-tuc', 'Công ty xây dựng nhà phố TPHCM uy tín, chuyên nghiệp, giá tốt', 'Công ty xây dựng nhà phố TPHCM', 'Nếu bạn đang đi tìm một công ty xây dựng nhà phố TPHCM uy tín, chuyên nghiệp thì hãy theo dõi ngay bài viết sau đây của chúng tôi nhé.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1109, 6, 'news', 'man', 'tin-tuc', 'Dịch vụ thiết kế và thi công xây dựng trọn gói mang lại những lợi ích gì?', '', 'Ngày nay, dịch vụ thiết kế và thi công xây dựng trọn gói ngày càng được nhiều chủ đầu tư quan tâm và lựa chọn. Bởi những lợi ích thiết thực mà loại hình này mang lại.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1110, 7, 'news', 'man', 'tin-tuc', 'Tại sao nên lựa chọn thiết kế thi công trọn gói nhà ở?', '', 'Hiện nay, thiết kế thi công trọn gói nhà ở là sự lựa chọn được khá nhiều các gia đình quan tâm vì đây là một phương án tiết kiệm được khá nhiều chi phí về giảm thiểu được rủi ro.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1111, 8, 'news', 'man', 'tin-tuc', 'Những điều cần lưu ý về nhà thầu xây dựng', '', 'Khi bắt đầu xây dựng một ngôi nhà hẳn sẽ có rất nhiều vấn đề khiến quý vị lo lắng, có lẽ vấn đề lớn nhất chính là việc chọn nhà thầu.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1112, 9, 'news', 'man', 'tin-tuc', 'Khám phá ưu điểm nổi trội của nhà mặt phố', '', 'Chắc chắn nhà phố, nhà ống phải có nhiều ưu điểm nổi trội mới khiến chủ nhân đưa ra quyết định như vậy. Khi bạn sở hữu một căn nhà mặt phố có rất nhiều ưu điểm ưu việt sau:', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1113, 10, 'news', 'man', 'tin-tuc', 'Các loại hình nhà phố phổ biến nhất hiện nay', '', 'Để đáp ứng nhu cầu sử dụng của con người mà các loại hình nhà phố cũng đa dạng không kém, cùng điểm qua các loại hình nhà phố phổ biến nhất hiện nay.', NULL, NULL, NULL);
