INSERT INTO `table_seo` VALUES (1485, 16, 'news', 'man', 'tin-tuc', 'Những mẫu nhà mái Thái đẹp hiện đại, sang trọng nhất 2023', 'thiết kế và xây dựng nhà mái Thái miền Tây', 'công ty Xây Dựng Hoàng Phúc, chuyên thiết kế và xây dựng nhà mái Thái miền Tây.  Với đội ngũ thợ chuyên nghiệp với kinh nghiệm lâu năm, công ty chúng tôi chuyên thiết kế và xây dựng nhà mái Thái miền Tây. Uy tín - Giá tốt - Nhà đẹp.', NULL, NULL, NULL);
