INSERT INTO `table_seo` VALUES (1529, 1, 'news', 'man', 'tin-tuc', 'Đâu là công ty xây dựng uy tín ở Kiên Giang tốt nhất hiện nay?', 'Công ty xây dựng uy tín ở Kiên Giang', 'Bài viết hôm nay chúng tôi giới thiệu về một công ty xây dựng uy tín ở Kiên Giang uy tín, chuyên nghiệp và chất lượng hàng đầu thị trường hiện nay.', NULL, NULL, NULL);
