INSERT INTO `table_seo` VALUES (1534, 6, 'news', 'man', 'tin-tuc', 'Dịch vụ thiết kế và thi công xây dựng trọn gói mang lại những lợi ích gì?', '', 'Ngày nay, dịch vụ thiết kế và thi công xây dựng trọn gói ngày càng được nhiều chủ đầu tư quan tâm và lựa chọn. Bởi những lợi ích thiết thực mà loại hình này mang lại.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1535, 7, 'news', 'man', 'tin-tuc', 'Tại sao nên lựa chọn thiết kế thi công trọn gói nhà ở?', '', 'Hiện nay, thiết kế thi công trọn gói nhà ở là sự lựa chọn được khá nhiều các gia đình quan tâm vì đây là một phương án tiết kiệm được khá nhiều chi phí về giảm thiểu được rủi ro.', NULL, NULL, NULL);
