INSERT INTO `table_seo` VALUES (1686, 100, 'product', 'man', 'thiet-ke-noi-that', 'Phòng khách biệt thự', 'nội thất phòng khách, noi that phong khach, nội thất tây ninh, noi that tay ninh', 'THiết kế - thi công công trình nội thất Hoàng Phúc tại Tây Ninh. Mẫu thiết kế nội thất phòng khách biệt thự đẹp, hiện đai...', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1687, 101, 'product', 'man', 'thiet-ke-noi-that', 'Phòng khách nhà phố', 'noi that nha pho, nội thất nhà phố, nội thất tây ninh, noi that tay ninh', 'Đơn Vị Thiết kế - thi công công trình nội thất Hoàng phúc, chuyên nhận thiết kế thi công các công trình biệt thự, nhà phố tai tỉnh Tây Ninh', NULL, NULL, NULL);
