INSERT INTO `table_seo` VALUES (1780, 32, 'news', 'man', 'tin-tuc', 'Đâu là công ty xây dựng uy tín ở Kiên Giang tốt nhất hiện nay?', 'Công ty xây dựng uy tín ở Kiên Giang', 'Bài viết hôm nay chúng tôi giới thiệu về một công ty xây dựng uy tín ở Kiên Giang uy tín, chuyên nghiệp và chất lượng hàng đầu thị trường hiện nay.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1781, 33, 'news', 'man', 'tin-tuc', 'Thiết kế biệt thự đẹp Cần Thơ đẹp, độc đáo, đẳng cấp, hiện đại', 'Thiết kế biệt thự đẹp Cần Thơ', 'Công ty thiết kế biệt thự đẹp Cần Thơ - HOÀNG PHÚC là một trong những công ty thiết kế biệt thự Cần Thơ uy tín chuyên nghiệp hàng đầu.', NULL, NULL, NULL);
