INSERT INTO `table_seo` VALUES (1909, 41, 'news', 'man', 'tin-tuc', 'Các loại hình nhà phố phổ biến nhất hiện nay', '', 'Để đáp ứng nhu cầu sử dụng của con người mà các loại hình nhà phố cũng đa dạng không kém, cùng điểm qua các loại hình nhà phố phổ biến nhất hiện nay.', NULL, NULL, NULL);
