INSERT INTO `table_seo` VALUES (1963, 35, 'news', 'man', 'tin-tuc', 'Khám phá một công ty xây dựng Tây Ninh chuyên nghiệp, uy tín', 'Công ty xây dựng Tây Ninh', 'Điều quan trọng nhất là phải tìm kiếm một công ty xây dựng Tây Ninh uy tín để có thể tạo nên một ngôi nhà ưng ý nhất cho mình.', NULL, NULL, NULL);
