INSERT INTO `table_seo` VALUES (1965, 37, 'news', 'man', 'tin-tuc', 'Dịch vụ thiết kế và thi công xây dựng trọn gói mang lại những lợi ích gì?', '', 'Ngày nay, dịch vụ thiết kế và thi công xây dựng trọn gói ngày càng được nhiều chủ đầu tư quan tâm và lựa chọn. Bởi những lợi ích thiết thực mà loại hình này mang lại.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1966, 38, 'news', 'man', 'tin-tuc', 'Tại sao nên lựa chọn thiết kế thi công trọn gói nhà ở?', '', 'Hiện nay, thiết kế thi công trọn gói nhà ở là sự lựa chọn được khá nhiều các gia đình quan tâm vì đây là một phương án tiết kiệm được khá nhiều chi phí về giảm thiểu được rủi ro.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (1967, 39, 'news', 'man', 'tin-tuc', 'Những điều cần lưu ý về nhà thầu xây dựng', '', 'Khi bắt đầu xây dựng một ngôi nhà hẳn sẽ có rất nhiều vấn đề khiến quý vị lo lắng, có lẽ vấn đề lớn nhất chính là việc chọn nhà thầu.', NULL, NULL, NULL);
