INSERT INTO `table_seo` VALUES (2153, 45, 'news', 'man', 'tin-tuc', 'Công ty chuyên thiết kế nhà phố Bạc Liêu chất lượng, giá tốt nhất', 'Công ty chuyên thiết kế nhà phố Bạc Liêu', 'Lựa chọn một công ty chuyên thiết kế nhà phố Bạc Liêu đảm bảo uy tín cũng là một công đoạn vất vả chẳng kém mà các gia chủ phải lưu tâm.', NULL, NULL, NULL);
