INSERT INTO `table_seo` VALUES (2205, 37, 'news', 'man', 'tin-tuc', 'Dịch vụ thiết kế và thi công xây dựng trọn gói mang lại những lợi ích gì?', '', 'Ngày nay, dịch vụ thiết kế và thi công xây dựng trọn gói ngày càng được nhiều chủ đầu tư quan tâm và lựa chọn. Bởi những lợi ích thiết thực mà loại hình này mang lại.', NULL, NULL, NULL);
