INSERT INTO `table_seo` VALUES (2265, 37, 'news', 'man', 'tin-tuc', 'Dịch vụ thiết kế và thi công xây dựng trọn gói mang lại những lợi ích gì?', '', 'Ngày nay, dịch vụ thiết kế và thi công xây dựng trọn gói ngày càng được nhiều chủ đầu tư quan tâm và lựa chọn. Bởi những lợi ích thiết thực mà loại hình này mang lại.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (2266, 38, 'news', 'man', 'tin-tuc', 'Tại sao nên lựa chọn thiết kế thi công trọn gói nhà ở?', '', 'Hiện nay, thiết kế thi công trọn gói nhà ở là sự lựa chọn được khá nhiều các gia đình quan tâm vì đây là một phương án tiết kiệm được khá nhiều chi phí về giảm thiểu được rủi ro.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (2267, 39, 'news', 'man', 'tin-tuc', 'Những điều cần lưu ý về nhà thầu xây dựng', '', 'Khi bắt đầu xây dựng một ngôi nhà hẳn sẽ có rất nhiều vấn đề khiến quý vị lo lắng, có lẽ vấn đề lớn nhất chính là việc chọn nhà thầu.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (2268, 40, 'news', 'man', 'tin-tuc', 'Khám phá ưu điểm nổi trội của nhà mặt phố', '', 'Chắc chắn nhà phố, nhà ống phải có nhiều ưu điểm nổi trội mới khiến chủ nhân đưa ra quyết định như vậy. Khi bạn sở hữu một căn nhà mặt phố có rất nhiều ưu điểm ưu việt sau:', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (2269, 41, 'news', 'man', 'tin-tuc', 'Các loại hình nhà phố phổ biến nhất hiện nay', '', 'Để đáp ứng nhu cầu sử dụng của con người mà các loại hình nhà phố cũng đa dạng không kém, cùng điểm qua các loại hình nhà phố phổ biến nhất hiện nay.', NULL, NULL, NULL);
