INSERT INTO `table_seo` VALUES (2271, 43, 'news', 'man', 'tin-tuc', 'Nhà thầu xây nhà trọn gói tại Tây Ninh uy tín, chuyên nghiệp', 'Nhà thầu xây nhà trọn gói tại Tây Ninh', 'Nếu bạn đang có nhu cầu tìm kiếm một nhà thầu xây nhà trọn gói tại Tây Ninh uy tín, chuyên nghiệp thì đến ngay với HOÀNG PHÚC.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (2272, 44, 'news', 'man', 'tin-tuc', 'Đơn vị chuyên xây nhà trọn gói giá rẻ Tây Ninh chất lượng, uy tín', 'Xây nhà trọn gói giá rẻ Tây Ninh', 'Xây nhà trọn gói giá rẻ Tây Ninh chính là một dịch vụ của các đơn vị xây dựng và các gia chủ sẽ là khách hàng sử dụng dịch vụ.', NULL, NULL, NULL);
INSERT INTO `table_seo` VALUES (2273, 45, 'news', 'man', 'tin-tuc', 'Công ty chuyên thiết kế nhà phố Bạc Liêu chất lượng, giá tốt nhất', 'Công ty chuyên thiết kế nhà phố Bạc Liêu', 'Lựa chọn một công ty chuyên thiết kế nhà phố Bạc Liêu đảm bảo uy tín cũng là một công đoạn vất vả chẳng kém mà các gia chủ phải lưu tâm.', NULL, NULL, NULL);
