INSERT INTO `table_static` VALUES (1, 'news-2-1467-6233.jpg', '{\"p\":\"news-2-1467-6233.jpg\",\"w\":1140,\"h\":800,\"m\":\"image\\/jpeg\"}', 've-thanh-e-tan-binh', '', '&lt;p&gt;Nike has always led the market for creativity in its designs. Flyknit shoelace technology is a prime example.&lt;br /&gt;\r\nNike is the market leader in sportswear. This is thanks to Nike possessing a series of state-of-the-art sports technologies such as Dri-fit technology in clothing production, Air Max air cushioning technology. However, when it comes to Nike shoes, we can\'t help but mention Flyknit body technology.&lt;br /&gt;\r\nIntroducing Nike Flyknit technology&lt;br /&gt;\r\nFlyknit technology when introduced in 2012 (photo: sivasdescalzo.com)&lt;br /&gt;\r\nFlyknit is the result of years of research in Nike\'s innovation kitchen. This technology was officially introduced in 2012 at the London Olympics.&lt;br /&gt;\r\nFlyknit owns impressive specs. The entire shoe body is woven from flyknit yarn weighs only 34 grams, when combined with the sole, the total weight of the Flyknit Racer shoes is only 160 grams.&lt;br /&gt;\r\nThis means that athletes will wear shoes that are only half or two-third lighter than they used to be.&lt;br /&gt;\r\nThe essence of the Flynknit technology is the most resilient, monolithic elastomeric fabrics with the latest in digital weaving technology. There are no seams or seams on a sole.&lt;br /&gt;\r\nAs a result, Flyknit is not only light, but also very hugging and can be suitable for all sports such as soccer, jogging, basketball ... etc.&lt;br /&gt;\r\nFlyknit spreading&lt;/p&gt;\r\n', '&lt;p&gt;&lt;em&gt;&lt;strong&gt;THANH E TỔNG KHO BUÔN SỈ QUẦN ÁO TRẺ EM GIÁ RẺ , XƯỞNG MAY QUẦN ÁO TRẺ EM LỚN NHẤT CHỢ TÂN BÌNH -  THANH E TÂN BÌNH&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;em&gt;Gọi đặt hàng số: 0903 812 441&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Tổng kho buôn, xưởng sỉ sản xuất số lượng lớn quần áo trẻ em , quảng Châu , thiết kế mẫu mã  hot trend giá rẻ cho khách bán chợ , shop , online, offline. Nhận đặt hàng theo yêu cầu, đảm bảo uy tín, chất lượng đi đầu. Cập nhật mẫu mã đi đầu theo xu hướng .&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;LÊN ĐƠN SỈ NHANH , MỐI BUÔN SỈ UY TÍN HÀNG ĐÂU CHỢ TÂN BÌNH CHO CÁC NƯỚC .&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;THANH E&lt;/strong&gt; với nhiều sản xuất và buôn sỉ và cung cấp số lượng lớn QUẦN ÁO TRẺ EM GIÁ RẺ chuyên đóng hàng xuất khẩu , lào campuchia , thái lan ấn độ , hàn quốc  &lt;/p&gt;\r\n\r\n&lt;p&gt;Liên Hệ&lt;/p&gt;\r\n\r\n&lt;p&gt;Địa Chỉ : 58/11 Ni Sư Huỳnh Liên, P. 10, Q. Tân Bình&lt;/p&gt;\r\n\r\n&lt;p&gt;Hotline : 0903 812 441&lt;/p&gt;\r\n\r\n&lt;p&gt;Website : http://siquanaotreemquangchau.com/&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n', 'Soon after, products that used Flyknit bodies were bought by athletes and casual users alike, leading to a sales boom.\r\nThe flyknit shoes, while very expensive, sell out quickly. This reinforces Nike\'s market leadership in sports.', 'THANH E TỔNG KHO BUÔN SỈ QUẦN ÁO TRẺ EM GIÁ RẺ , XƯỞNG MAY QUẦN ÁO TRẺ EM LỚN NHẤT CHỢ TÂN BÌNH -  THANH E TÂN BÌNH Gọi đặt hàng số: 0903 812 441 Tổng kho buôn, xưởng sỉ sản xuất số lượng lớn quần áo trẻ em , quảng Châu , thiết kế mẫu mã  hot trend giá rẻ cho khách bán chợ , shop , online, offline. Nhận đặt hàng theo yêu cầu, đảm bảo uy tín, chất lượng đi đầu. Cập nhật mẫu mã đi đầu theo xu hướng .', 'About us', 'VỀ THANH E TÂN BÌNH', '', 'gioi-thieu', 'hienthi', 1609288150, 1704273203);
